      <div>
        <img src={mario} alt="mario" />
        <span>Mario</span>
      </div>
      <div>
        <img src={bandicoot} alt="bandicoot" />
        <span>Bandicoot</span>
      </div>
      <div>
        <img src={pikachu} alt="pikachu" />
        <span className="p">Pikachu</span>
      </div>
    </div>
  );
}
